const Ground = styled.section`
  width: 100vw;
  height: auto;
`

const SectionDiv = styled.section`
  width: 500px;
  height: 100px;
  border: 1px black solid;
`;

function App() {
  return (
    <>
      <SectionDiv>hi</SectionDiv>
    </>
  );
}

export default App;
